import React from 'react';
import Card from './Card.js';

class CardList extends React.Component {
    render() {
        return (
            <div className="row">
                <div className="col-sm-3">
                    {this.props.items.map(item => <Card{...item} />)}
                </div>
            </div>
        )
    }
}

export default CardList;
